import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Carousel } from "react-bootstrap";
class DashPop extends Component {
  state = {};
  render() {
    return (
      <div className="dashOutlineWrapper">
        <div className="dashOutlineHeader">Popular recipes</div>
        <div id="dashPopItemWrapper">
          <div className="dashPopItem">
            <div style={{ justifyContent: "center", display: "flex" }}>
              <div className="dashPopItemTitle">Delicious Lamb Korma</div>
            </div>
          </div>
          <div className="dashPopItem"></div>
          <div className="dashPopItem"></div>
        </div>
      </div>
    );
  }
}

export default DashPop;
